// admin-dashboard/src/pages/Posts.js
import React, {useEffect, useState} from 'react';
import axios from 'axios';
export default function Posts(){
  const [posts,setPosts]=useState([]); const [q,setQ]=useState(''); const [cat,setCat]=useState(''); const [page,setPage]=useState(1); const limit=10;
  useEffect(()=>{ axios.get('http://localhost:5000/api/admin/posts',{headers:auth()}).then(r=>setPosts(r.data)).catch(()=>{}); },[]);
  function auth(){ const t=localStorage.getItem('token'); return t?{Authorization:'Bearer '+t}:{}; }
  function remove(id){ if(confirm('Delete?')){ axios.delete('http://localhost:5000/api/admin/post/'+id,{headers:auth()}).then(()=>setPosts(p=>p.filter(x=>x._id!==id))).catch(()=>{}); } }
  const cats = Array.from(new Set(posts.map(p=>p.category||'General')));
  const filtered = posts.filter(p=> (p.title||'').toLowerCase().includes(q.toLowerCase()) && (cat? (p.category===cat): true) );
  const pages = Math.max(1, Math.ceil(filtered.length/limit));
  const shown = filtered.slice((page-1)*limit, page*limit);
  return (
    <div>
      <div className="card" style={{marginBottom:12}}>
        <input placeholder="Search title" value={q} onChange={e=>{ setQ(e.target.value); setPage(1); }} />
        <select value={cat} onChange={e=>{ setCat(e.target.value); setPage(1); }} style={{marginLeft:8}}><option value=''>All</option>{cats.map(c=>(<option key={c} value={c}>{c}</option>))}</select>
      </div>
      <div className="card">
        <table className="table"><thead><tr><th>Title</th><th>Author</th><th>Category</th><th></th></tr></thead>
        <tbody>{shown.map(p=>(<tr key={p._id}><td>{p.title}</td><td>{p.author?.name}</td><td>{p.category}</td><td><button onClick={()=>window.location.href='/create?edit='+p._id} className="btn" style={{background:'#10b981'}}>Edit</button>&nbsp;<button onClick={()=>remove(p._id)} className="btn">Delete</button></td></tr>))}</tbody></table>
        <div style={{marginTop:12,display:'flex',justifyContent:'flex-end',gap:8}}><button onClick={()=>setPage(p=>Math.max(1,p-1))} disabled={page===1}>Prev</button><div>Page {page}/{pages}</div><button onClick={()=>setPage(p=>Math.min(pages,p+1))} disabled={page===pages}>Next</button></div>
      </div>
    </div>
  )
}
